import { TxtButton } from "../../styles/Buttons";
import { LinkTextBox } from "../../styles/TextStyles";

export function chooseAmountOfProducts(setNumber: any) {
  function setNumber(number: number) {
    setNumberOnSite(number);
  }
  return (
    <LinkTextBox>
      <TxtButton onClick={() => setNumber(30)}>30</TxtButton>|
      <TxtButton onClick={() => setNumber(30)}>60</TxtButton>|
      <TxtButton onClick={() => setNumber(30)}>90</TxtButton>
    </LinkTextBox>
  );
}
